--
-- Table structure for table `operacje_log`
--

DROP TABLE IF EXISTS `operacje_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `operacje_log` (
  `id` int NOT NULL AUTO_INCREMENT,
  `typ_operacji` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Np. TRANSFER, DODANIE_ZIEMI, FILTRACJA_KOO',
  `id_partii_surowca` int DEFAULT NULL,
  `id_sprzetu_zrodlowego` int DEFAULT NULL,
  `id_sprzetu_docelowego` int DEFAULT NULL,
  `id_apollo_sesji` int DEFAULT NULL,
  `czas_rozpoczecia` datetime NOT NULL,
  `czas_zakonczenia` datetime DEFAULT NULL,
  `ostatnia_modyfikacja` datetime DEFAULT NULL,
  `zmodyfikowane_przez` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `uwagi` text COLLATE utf8mb4_unicode_ci,
  `ilosc_kg` decimal(10,2) DEFAULT NULL,
  `opis` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci,
  `status_operacji` enum('aktywna','zakonczona','wstrzymana','anulowana') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'aktywna',
  `punkt_startowy` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `punkt_docelowy` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id_partii_surowca` (`id_partii_surowca`),
  KEY `id_sprzetu_zrodlowego` (`id_sprzetu_zrodlowego`),
  KEY `id_sprzetu_docelowego` (`id_sprzetu_docelowego`),
  KEY `fk_operacje_log_apollo_sesje` (`id_apollo_sesji`),
  CONSTRAINT `fk_operacje_log_apollo_sesje` FOREIGN KEY (`id_apollo_sesji`) REFERENCES `apollo_sesje` (`id`),
  CONSTRAINT `operacje_log_ibfk_1` FOREIGN KEY (`id_partii_surowca`) REFERENCES `partie_surowca` (`id`) ON DELETE SET NULL,
  CONSTRAINT `operacje_log_ibfk_2` FOREIGN KEY (`id_sprzetu_zrodlowego`) REFERENCES `sprzet` (`id`) ON DELETE SET NULL,
  CONSTRAINT `operacje_log_ibfk_3` FOREIGN KEY (`id_sprzetu_docelowego`) REFERENCES `sprzet` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=194 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Log wszystkich zdarze i operacji w procesie';
/*!40101 SET character_set_client = @saved_cs_client */;

