CREATE TABLE `sprzet` (
  `id` int NOT NULL AUTO_INCREMENT,
  `nazwa_unikalna` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Np. R1, FZ, B1b, B7c',
  `typ_sprzetu` enum('reaktor','filtr','beczka_brudna','beczka_czysta','apollo','magazyn','cysterna','mauzer') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `pojemnosc_kg` decimal(10,2) DEFAULT NULL,
  `stan_sprzetu` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Np. Pusty, W koo, Przelew, Dmuchanie filtra',
  `temperatura_aktualna` decimal(10,6) DEFAULT NULL,
  `cisnienie_aktualne` decimal(5,2) DEFAULT NULL,
  `poziom_aktualny_procent` decimal(5,2) DEFAULT NULL,
  `ostatnia_aktualizacja` datetime DEFAULT NULL,
  `temperatura_max` decimal(10,6) DEFAULT '120.000000',
  `cisnienie_max` decimal(5,2) DEFAULT '6.00',
  `id_partii_surowca` int DEFAULT NULL,
  `temperatura_docelowa` decimal(10,6) DEFAULT NULL COMMENT 'Temperatura zadana przez operatora',
  `szybkosc_topnienia_kg_h` decimal(10,2) DEFAULT '1000.00' COMMENT 'Szacowana szybko topnienia surowca w kg na godzin',
  `uwagi_serwisowe` text COLLATE utf8mb4_unicode_ci,
  `active_mix_id` int DEFAULT NULL,
  `szybkosc_grzania_c_na_minute` decimal(10,6) DEFAULT NULL COMMENT 'Szacowana szybko grzania w C/min',
  `szybkosc_chlodzenia_c_na_minute` decimal(10,6) DEFAULT NULL COMMENT 'Szacowana szybko chodzenia w C/min',
  `stan_palnika` enum('WLACZONY','WYLACZONY') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Aktualny stan palnika reaktora',
  `filter_cake_status` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Status placka na filtrze (np. CZYSTY, T10_GOTOWY)',
  `filter_cake_origin_mix_id` int DEFAULT NULL COMMENT 'ID mieszaniny (TankMix), z ktrej pochodzi obecny placek',
  PRIMARY KEY (`id`),
  UNIQUE KEY `nazwa_unikalna` (`nazwa_unikalna`),
  KEY `ix_sprzet_active_mix_id` (`active_mix_id`)
) ENGINE=InnoDB AUTO_INCREMENT=118 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Lista caego sprztu produkcyjnego i magazynowego';
